import styled from 'styled-components';

const Styles = styled.div`
    item: {
        width: 500px;
    }
`;
export const Home = () => (
        <Row >
                    <Col>PLĂȚI SECURIZATE</Col>
                    <Col>LIVRARE ÎN 3 ORE</Col>
                    <Col>100% DISCREȚIE ȘI GARANȚIE</Col>
                    <Col>FELICITARE CADOU</Col>
        </Row>
)
